import React from 'react';

function Showclick() {
  const words = [
    "あ", "い", "う", "え", "お",
    "か", "き", "く", "け", "こ",
    "さ", "し", "す", "せ", "そ"
  ];

  const randomIndex = Math.floor(Math.random() * words.length);
  
  return(randomIndex);
}

const Displayframe = () => {
  return (
    <div>
      <button onClick={Showclick}>
        Click me!
      </button>
    </div>
  );
}

export default Displayframe;
